import React from 'react';
import styled from 'styled-components';

const HomeContainer = styled.div`
  padding: 2rem;
  max-width: 1200px;
  margin: 0 auto;
`;

const HeroSection = styled.div`
  text-align: center;
  color: white;
  padding: 4rem 0;
`;

const Title = styled.h1`
  font-size: 3.5rem;
  color: #ff9000;
  margin-bottom: 1rem;
`;

const Subtitle = styled.p`
  font-size: 1.5rem;
  color: #cccccc;
  margin-bottom: 2rem;
`;

const SearchBar = styled.input`
  width: 80%;
  max-width: 600px;
  padding: 1rem;
  border-radius: 25px;
  border: none;
  background-color: #1a1a1a;
  color: white;
  font-size: 1.1rem;
  
  &:focus {
    outline: 2px solid #ff9000;
  }
`;

const Home = () => {
  return (
    <HomeContainer>
      <HeroSection>
        <Title>Welcome to LippHub</Title>
        <Subtitle>Discover My IT Projects Collection</Subtitle>
        <SearchBar 
          type="text" 
          placeholder="Search projects..."
        />
      </HeroSection>
    </HomeContainer>
  );
};

export default Home;
